import React from "react";
import "../Css/Fertilizers.css";

function Fertilizers() {
  const fertList = [
    // ⭐ Nitrogen Fertilizers
    { id: 1, name: "Urea Fertilizer", price: 650, img: "/Images/urea.jpg" },
    { id: 2, name: "Ammonium Sulphate", price: 720, img: "/Images/ammonium-sulphate.jpg" },
    { id: 3, name: "Calcium Ammonium Nitrate (CAN)", price: 800, img: "/Images/can.jpg" },

    // ⭐ NPK Fertilizers
    { id: 4, name: "NPK 20-20-20", price: 900, img: "/Images/npk.jpg" },
    { id: 5, name: "NPK 10-26-26", price: 1100, img: "/Images/npk2.jpg" },
    { id: 6, name: "NPK 12-32-16", price: 1050, img: "/Images/npk3.jpg" },

    // ⭐ Phosphorus Fertilizers
    { id: 7, name: "Single Super Phosphate (SSP)", price: 450, img: "/Images/ssp.jpg" },
    { id: 8, name: "DAP Fertilizer (18-46-0)", price: 1350, img: "/Images/dap.jpg" },

    // ⭐ Potassium Fertilizers
    { id: 9, name: "Potash Fertilizer (MOP)", price: 750, img: "/Images/potash.jpg" },
    { id: 10, name: "SOP – Sulphate of Potash", price: 880, img: "/Images/sop.jpg" },

    // ⭐ Organic Fertilizers
    { id: 11, name: "Organic Compost", price: 300, img: "/Images/compost.jpg" },
    { id: 12, name: "Vermicompost", price: 450, img: "/Images/vermicompost.jpg" },
    { id: 13, name: "Seaweed Extract Fertilizer", price: 550, img: "/Images/seaweed.jpg" },
    { id: 14, name: "Humic Acid Granules", price: 480, img: "/Images/humic.jpg" }
  ];

  return (
    <div className="fert-container">
      <h2 className="fert-title">
        <i className="fa fa-leaf"></i> Fertilizers & Nutrition
      </h2>

      <div className="fert-grid">
        {fertList.map((item) => (
          <div className="fert-card" key={item.id}>
            <img src={item.img} alt={item.name} className="fert-img" />

            <h3 className="fert-name">{item.name}</h3>

            <p className="fert-price">
              <i className="fa fa-rupee-sign"></i> {item.price}
            </p>

            <button className="fert-btn">
              <i className="fa fa-shopping-cart"></i> Buy Fertilizer
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Fertilizers;
